import React from 'react';
import ProjectCard from '../Components/ProjectCard';

const Projects = () => {
  const projects = [
    {
      title: "E-Commerce Mobile App",
      description: "A modern e-commerce mobile application with intuitive shopping experience, featuring smooth animations and clean design patterns.",
      image: "https://images.unsplash.com/photo-1556742049-0cfed4f6a45d?w=500&h=300&fit=crop",
      tags: ["UI/UX Design", "React Native", "Figma"],
      link: "https://example.com",
      github: "https://github.com"
    },
    {
      title: "SaaS Dashboard",
      description: "Comprehensive analytics dashboard for SaaS companies with real-time data visualization and customizable widgets.",
      image: "https://images.unsplash.com/photo-1551288049-bebda4e38f71?w=500&h=300&fit=crop",
      tags: ["React", "D3.js", "TypeScript", "Design System"],
      link: "https://example.com",
      github: "https://github.com"
    },
    {
      title: "Portfolio Website",
      description: "Personal portfolio website showcasing design and development work with glassmorphism design and smooth interactions.",
      image: "https://images.unsplash.com/photo-1467232004584-a241de8bcf5d?w=500&h=300&fit=crop",
      tags: ["React", "CSS3", "JavaScript", "Responsive Design"],
      link: "https://example.com",
      github: "https://github.com"
    },
    {
      title: "Food Delivery App",
      description: "Mobile-first food delivery application with restaurant discovery, order tracking, and payment integration.",
      image: "https://images.unsplash.com/photo-1565299624946-b28f40a0ca4b?w=500&h=300&fit=crop",
      tags: ["UI/UX Design", "Prototyping", "User Research"],
      link: "https://example.com",
      github: "https://github.com"
    },
    {
      title: "Fitness Tracker",
      description: "Comprehensive fitness tracking application with workout planning, progress monitoring, and social features.",
      image: "https://images.unsplash.com/photo-1571019613454-1cb2f99b2d8b?w=500&h=300&fit=crop",
      tags: ["React", "Node.js", "MongoDB", "Chart.js"],
      link: "https://example.com",
      github: "https://github.com"
    },
    {
      title: "Design System",
      description: "Comprehensive design system with reusable components, guidelines, and documentation for consistent UI development.",
      image: "https://images.unsplash.com/photo-1558655146-d09347e92766?w=500&h=300&fit=crop",
      tags: ["Design System", "Figma", "Storybook", "Documentation"],
      link: "https://example.com",
      github: "https://github.com"
    }
  ];

  return (
    <div className="projects-page">
      <div className="projects-container">
        <div className="projects-header">
          <h1 className="projects-title">My Projects</h1>
          <p className="projects-description">
            A collection of my recent work in UI/UX design and front-end development. 
            Each project represents a unique challenge and learning opportunity.
          </p>
        </div>
        
        <div className="projects-grid">
          {projects.map((project, index) => (
            <ProjectCard key={index} project={project} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Projects;
